arrays/array-destructuring.html.body:
Array destructuring
Destructuring allows to extract data from arrays or objects into distinct variables
// Old way
let users = ["Sam","Tyler","Brook"];
let a = users[0];
let b = users[1];
let c = users[2];
console.log(a,b,c);

// ES6 way
let users = ["Sam","Tyler","Brook"];
let [a, b, c] = users;
console.log(a, b, c); // Sam Tyler Brook

Another example
let [x, y] = [1, 2]; // x = 1, y = 2

// Old way
var arr = [1, 2];
var x = arr[0];
var y = arr[1];

With this syntax, multiple variables can be assigned a value in one go.
let x = 1,
    y = 2;

[x, y] = [y, x]; // x = 2, y = 1

Destructuring arrays from return values
// When returning arrays from functions, we can assign to multiple variables at once
function activeUsers() {
    return ["Sam", "Alex", "Brook"];
}
let [a, b, c] = activeUsers();
console.log(a, b, c);

Ignoring some returned values
You can ignore return values that you're not interested in:
function activeUsers() {
  return ["Sam", "Alex", "Brook"];
}

let [a, , b] = activeUsers();
console.log(a); // Sam
console.log(b); // Brook

Combining Array destructuring with Rest parameters
let users = ["Sam","Tyler","Brook"];
let [first, ...rest] = users;
console.log(first + ", " + rest); // Sam, ["Tyler", "Brook"]

arrays/new-methods.html.body:
Array Static Methods
The Array object now has some new static class methods, as well as new methods on the Array prototype.
Array.from()
Array.from creates Array instances from array-like and iterable objects.Examples of array-like objects include:

a nodeList returned by document.getElementsByTagName();
the new Map and Set data structures.

The items array has the forEach method, which isn’t available in the itemElements collection
let itemElements = document.querySelectorAll('.items');
let items = Array.from(itemElements);
items.forEach((element) => {
    console.log(element.nodeType)
});

// A workaround often used in ES5:
let items = Array.prototype.slice.call(itemElements);

An interesting feature of Array.from is the second optional mapFunction argument. 
This allows you to create a new mapped array in a single invocation:
let navElements = document.querySelectorAll('nav li'),
    navTitles = Array.from(navElements, el => el.textContent);

Array.of()
Array.of behaves much like the Array constructor. 
It fixes the special case when passing it a single number argument. 
This results in Array.of being preferable to new Array(). 
However, in most cases, you’ll want to use array literals.
let x = new Array(3); // [undefined, undefined, undefined]
let y = Array.of(8); // [8]
let z = [1, 2, 3]; // Array literal

Array Prototype Methods
Last but not least, a couple of methods have been added to the Array prototype.I think the find methods will be very welcome to most JavaScript developers.
Array.find()
Array.find returns the first element in the array that satisfies a provided testing function
// Find an admin in this array of users
let names = [{
    login: "Sam",
    isAdmin: false
}, {
    login: "Brook",
    isAdmin: true
}, {
    login: "Tyler",
    isAdmin: true
}];

// Returns first object for which user.admin is true
let admin = users.find((user) => {
    return user.isAdmin;
});

console.log(admin); // {login: "Brook", isAdmin: true}

find returns the first element for which the callback returns true.findIndex returns the index of the first element for which the callback returns true.fill “overwrites” the elements of an array with the given argument.
[5, 1, 10, 8].find(n => n === 10) // 10

[5, 1, 10, 8].findIndex(n => n === 10) // 2

[0, 0, 0].fill(7); // [7, 7, 7]
[0, 0, 0, 0, 0].fill(7, 1, 3); // [0, 7, 7, 7, 0]

Array.copyWithin()
The copyWithin() method shallow copies part of an array to another location in the same array and returns it, without modifying its size. Though copyWithin() don't change array size, it mutates the array.
["alpha", "bravo", "charlie", "delta"].copyWithin(2, 0);
// results in ["alpha", "bravo", "alpha", "bravo"]

async-await/.body:
Async Functions and await operator
Async function can contain await expression, that pauses the execution of the async function and waits for the passed promise's resolution, and resumes the async function's execution and returns the resolved value.
// Some function that returns a Promise
function getPromise() {
    return new Promise((resolve, reject) => Math.random() > .5 ? resolve('Lucky') : reject('Bad Luck'));
}

/*
async function
async/await let you write asynchronous code, using synchronous code structure
*/
async function main() {
    let result;
    // await receives a Promise, if rejected goes to catch block with respective error
    try {
        result = await getPromise();
    } catch (error) {
        result = `Error: ${error}`;
    }
    console.log(result);
}

// Run async function
main();

classes/.body:
Classes
Classes are a well-debated feature of ES6. Some believe that they go against the prototypal nature of JavaScript, while others think they lower the barrier to entry for beginners and people coming from other languages and that they help people writing large-scale applications. In any case, they are part of ES6. Here’s a very quick introduction.
Classes are built around the class and constructor keywords
class Vehicle {
       // constructor runs everytime a new instance is create with 'new'
       constructor(name){ 
          this.name = name;
          this.kind = 'vehicle';
       }
       getName() {
          return this.name;
       },
       // Prefixing with underscore. Convention for private
       _privateMethod() { 
          //...
   }
}

// Create an instance
let myVehicle = new Vehicle('rocky');

Note that the class definition is not a regular object. Hence, there are no commas between class members.
The constructor method is a special method for creating and intializing an object
To create an instance of a class, you must use the new keyword.
let myCar = new Car('bumpy');

Creating a subclass
To inherit from a base class, use extends:
class Car extends Vehicle {
    constructor(name) {
          super(name);
          this.kind = 'car'
    }
}

let myCar = new Car('bumpy');
myCar.getName(); // 'bumpy'
myCar instanceof Car; // true

From the derived class, you can use super from any constructor or method to access its base class:
To call the parent constructor, use super()
To call another member, use, for example, super.getName()
Example of subclass:
class Animal {
    constructor(voice) {
        this.voice = voice || 'grunt';
    }
    speak() {
        display(this.voice);
    }
}

class Cat extends Animal {
    constructor(name, color) {
        super('Meow');
        this.name = name;
        this.color = color;
    }
}

let fluffy = new Cat('Fluffy', 'White');
display(Object.keys(fluffly.__proto__.__proto__)); // Array
display(fluffy.__proto__.__proto__.hasOwnProperty('speak')); // true

