generators/.body:
Generators
A Generator manages its own iterative state, they are 'pausable' functions.
A function becomes a generator if it contains one or more yield expressions and if it uses the function* syntax.
The next() method of a Generator
The next() lets you iterate your generator.
When you assign a variable that store your generator function like:
const ajaxGenSetup = ajaxGen();
You have as many next() methods to use as the number of yields present in the generator function, until done = true
The next() method returns an object with two properties, done and value.
{ value: 3, done: false }
Each yield keyword is a stop point for a next() method
On the function below, when there are no more yields left to stop, the generator returns the property done as true
let myGenerator = function*() {
    yield 1;
    yield 2;
    yield 3;
};

// Store and setup myGenerator
let gen = myGenerator();

// The next method returns what it is programmed to be yielded on the function
console.log(gen.next()); // { value: 1, done: false } 
console.log(gen.next()); // { value: 2, done: false } 
console.log(gen.next()); // { value: 3, done: false }
console.log(gen.next()); // { value: undefined, done: true }

Sending values to the Generator via next() method
function *foo() {
    let x = 1 + (yield "foo");
    console.log(x);
}

let storeGen = foo();
storeGen.next(); // {value: "foo", done: false}
storeGen.next(50); // {value: undefined, done: true}
// Logs x = 51;

The yield "foo" expression will send the "foo" string value out when pausing the generator function at that point, and whenever the generator is restarted with another next() function, whatever value is sent in, will be the result of that yield expression, which will then get added to 1 and assigned to the x variable.
It's almost as if the yield keyword is pausing and sort of making an external request for a value. Waiting for the next next() with a value in it
The value passed on the next() method kind of 'replaces' the entire yield expression that was last paused on.
Generators for Async actions
We can set a specific order for asynchronous request to run with generators.
Got this example in a very good ES6 course of a friend of mine. The course is in portuguese.
function ajax(url) {
    fetch(url)
        .then(data => data.json())
        // This function calls the next yield inside ajaxGen with the fetched data as argument
        .then(data => ajaxGenSetup.next(data));
}

// Asynchronous code that seems like it is synchronous
function* ajaxGen() {
    console.log('Searching posts...');
    const posts = yield ajax('https://willianjusten.com.br/search.json');
    console.log(posts);
    console.log('Searching data from Github...');
    const github = yield ajax('https://api.github.com/users/willianjusten');
    console.log(github);
    console.log('Searching data from Github 2...');
    const github2 = yield ajax('https://api.github.com/users/willianjusten');
    console.log(github2);
}

// Gets the generator and all next() methods according to the number of yields in it
const ajaxGenSetup = ajaxGen();

// This first next() triggers the generator and stop on the first yield 
// Has value of undefined, because there was no 'yield' initially 'waiting' for a value
ajaxGenSetup.next(); // {value: undefined, done: false}

// Searching posts...
// Ajax Data
// Searching data from Github...
// Ajax Data
// Searching data from Github 2...
// Ajax Data

iterators-and-iterables/.body:
Iterator
An object is an iterator when it knows how to access items from a collection one at a time, while keeping track of its current position within that sequence.
In JavaScript an iterator is an object that provides a next() method which returns the next item in the sequence. This method returns an object with two properties: done and value.
// Example of a custom Iterator Creator
function makeCustomIterator (array) {
    let nextIndex = 0;
    return {
        next() {
            return nextIndex 
Custom iterators like makeCustomIterator requires the management of the internal state of the iterator. Generators are "iterators factories", where the keyword yield sets the point in which the function will stop when the next next() method is called
The same result of makeCustomIterator function could be achieved with a generator without having to manually manage the state of the iterator, and what should be returned.
Iterables
An object is iterable if it defines its iteration behavior, such as what values are looped over in a for..of construct.
In order to be iterable, an object must implement the @@iterator method, the object (or one of the objects up its prototype chain) must have a property with a Symbol.iterator key
Built-in iterables
String, Array, TypedArray, Map and Set are all built-in iterables, because the prototype objects of them all have a Symbol.iterator method
function runIterable (iterable) {
    for (let element of iterable) {
        console.log('Iterable element: ', element);
    }
}

runIterable(['Gabriel', 'Godoy']);
// Iterable element:  Gabriel
// Iterable element:  Godoy

runIterable('Gabriel');
// Iterable element:  G
// Iterable element:  a
// Iterable element:  b
// Iterable element:  r
// Iterable element:  i
// Iterable element:  e
// Iterable element:  l

Custom Iterable
This literal object below natively neither have nor inherit Symbol.iterator property. But we can make this one Iterable by addin [Symbol.iterator] property to it.
let myIterable = {};
// Add Symbol.iterator to it
myIterable[Symbol.iterator] = function* () {
    yield 1;
    yield 2;
    yield 3;
};
// And now it becomes iterable
for(let value of myIterable){
    console.log(value);
}
// 1
// 2
// 3

